่ถูกต้องจะแรงดันในการทดสอบ ดังนั้น คำแนะนำในการเลือกซื้อหน้ากากอนามัยจะต้องตรวจสอบจากแหล่งที่มาที่น่าเชื่อถือได้\n\n#CoronaVirusFacts #COVID19 #ชัวร์ก่อนแชร์ #stayhome #withme\n------------------------------------------------------\n\nพบกันทุกวันใน ข่าวค่ำ ช่อง 9 MCOT HD \n\n✮ หากได้รับอะไรมา อย่าเพิ่งแชร์ต่อ ส่งมาตรวจสอบกับ \"ศูนย์ชัวร์ก่อนแชร์\" ✮\n► แอดไลน์ (LINE) : @TNAMCOT หรือคลิก http://line.me/ti/p/%40tnamcot \n► เฟซบุ๊ก : https://www.facebook.com/SureAndShare\n► ทวิตเตอร์ : https://www.twitter.com/SureAndShare\n► อินสตาแกรม : https://instagram.com/SureAndShare\n► เว็บไซต์ : https://www.ชัวร์ก่อนแชร์.com","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/0wYHFL_cqPc/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCeogcALexDNTAA2otEDCSpzU42yA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/0wYHFL_cqPc/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLC22WcKQ44eCG-qvmPjhKfk6LMb7g","width":196,"height":110},{"url":"https://i.ytimg.com/vi/0wYHFL_cqPc/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCGIsX1O7crjWbLLgwLgH4KxiKADA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/0wYHFL_cqPc/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCJ7jDLHkRfPAiFsi4FNGxGcI1pvg","width":336,"height":188},{"url":"https://i.ytimg.com/vi/0wYHFL_cqPc/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"4809","author":"ชัวร์ก่อนแชร์ Sure And Share","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"168000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/5Bd7izFr5x3jNL0peJpmaA/featured_channel.jpg?v=5fabe30b","width":40,"height":40}]},"trackingParams":"CAkQ8zciEwiOi6fDrrr4AhUsxREIHTeZA6s=","navigationEndpoint":{"clickTrackingP cZrw|80#45#96#10#10#2000#M$M#rs$AOn4CLAfzPxkFCjAxgoyndtgSYcjUqJl9Q|160#90#96#5#5#2000#M$M#rs$AOn4CLAdp3cRYwdU_ADXmlH_OO3GCRHO_A"}},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/0wYHFL_cqPc/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/0wYHFL_cqPc?list=PLQM82xOBx-5uY4lw0pOOm5url9nVSVu5H","flashUrl":"http://www.youtube.com/v/0wYHFL_cqPc?list=PLQM82xOBx-5uY4lw0pOOm5url9nVSVu5H\u0026version=3","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/0wYHFL_cqPc?list=PLQM82xOBx-5uY4lw0pOOm5url9nVSVu5H\u0026version=3"},"title":{"simpleText":"วิธีตรวจสอบหน้ากากอนามัยด้วยการเป่าไฟแช็ก จริงหรือ ? | ความจริง-โควิด | ชัวร์ก่อนแชร์ FACTSHEET"},"description":{"simpleText":"...บนสังคมออนไลน์มีหลายข้อสงสัยเก่ียวกับวิธีการตรวจสอบหน้ากากอนามัยด้วยการใส่ แล้วลองเป่าไฟแช็ก หากเป่าแล้วไม่ดับ ถือว่ามีประสิทธิภาพ จริงหรือ ?\n\nข้อเท็จจริงเป็นอย่างไร ร่วมตรวจสอบไปกับคุณพีรพล อนุตรโสตถิ์ จากศูนย์ชัวร์ก่อนแชร์ และ แพทย์หญิงพรรณพิมล วิปุลากร วิทยากรจาก อธิบดีกรมอนามัย กระทรวงสาธารณสุข\n\nตรวจสอบความจริง โดย พงศ์อิทธิ์ เชิดชูวงศ์\n\nสรุป : วิธีที่ปรากฎในคลิปไม่ใช่ ❌ วิธีการทดสอบหน้ากากอนามัย ที่ใช้ทดสอบในทางการแพทย์ เนื่องจากแรงในการเป่าลมของแต่ละคนไม่เท่ากัน และอาจจะต้องใช้ความระมัดระวังเนื่องจากไฟอาจจะลุกไหม้หน้ากากอนามัยได้\n\nส่วนการการทดสอบหน้ากากอนามัยที่ถูกต้องจะแรงดันในการทดสอบ ดังนั้น คำแนะนำในการเลือกซื้อหน้ากากอนามัยจะต้องตรวจสอบจากแหล่งที่มาที่น่าเชื่อถือได้\n\n#CoronaVirusFacts #COVID19 #ชัวร์ก่อนแชร์ #stayhome #withme\n------------------------------------------------------\n\nพบกันทุกวันใน ข่าวค่ำ ช่อง 9 MCOT HD \n\n✮ หากได้รับอะไรมา อย่าเพิ่งแชร์ต่อ ส่งมาตรวจสอบกับ \"ศูนย์ชัวร์ก่อนแชร์\" ✮\n► แอดไลน์ (LINE) : @TNAMCOT หรือคลิก http://line.me/ti/p/%40tnamcot \n► เฟซบุ๊ก : https://www.facebook.com/SureAndShare\n► ทวิตเตอร์ : https://www.twitter.com/SureAndShare\n► อินสตาแกรม : https://instagram.com/SureAndShare\n► เว็บไซต์ : https://www.ชัวร์ก่อนแชร์.com"},"l
